    }
    var doGlow = true;
    function GlowIcons()
    {
	if(doGlow)
	{
		Best_Practices_Tab.animate(500,'>',0).scale(1.2, 1.2);
		setTimeout(function(){Best_Practices_Tab.animate(500,'>',0).scale(1, 1);Design_Patterns_Tab.animate(500,'>',0).scale(1.2, 1.2);}, 500);
